import axios from "axios";
import {
  fetchTicketLoading,
  fetchTicketSuccess,
  fetchTicketFail,
} from "./ticketSlice";

export const fetchAllTickets = () => async (dispatch) => {
  dispatch(fetchTicketLoading());

  try {
    const result = await axios.get("http://localhost:3001/v1/ticket", {
      headers: {
        Authorization:
          "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6Im9rb3BAcC5jb20iLCJpYXQiOjE2MjUwNTIxMTQsImV4cCI6MTYyNTA1MzAxNH0.hUiibNOtOB3cnNsyrSD769ipRtturi9pGQOPITvBeLc",
      },
    });
    console.log(result);
    dispatch(fetchTicketSuccess());
  } catch (error) {
    dispatch(fetchTicketFail(error.message));
  }
};
